import { FcRating } from 'react-icons/fc';
import {IconContext} from "react-icons";


export default function FavoriteCardButton() {
    return (
        <IconContext.Provider value={{
            size: 50 ,
            position: "absolute",
            marginRight: '20px',
            left: '50%',
            textAlign: 'center',
            transformTranslate:'50%,50%'

        }}>
            <h3> <FcRating /></h3>
        </IconContext.Provider>

)
};
